import React from 'react';
import './Login.css';
export default function Login() {
    return (
        <div className='login-wrapper'>
            <img className="signin--header" src="https://tix.vn/app/assets/img/login/group@2x.png" ng-click="backToHomepage(0)" />

            <div className="signin-close" ng-click="backToHomepage(0)" />

        </div>


    );
}
